function [OP,COP,EO]=mitpts(i)
%MITPTS Return object points computed by bundle adjustment.
%
%   [OP,C]=MITPTS(V), where V=1, 2, or 3, returns the 3-by-N array OP
%   with object point coordinates on the MIT building computed by
%   bundle adjustment from one of three image pairs. The 3N-by-3N
%   sparse array C contain the covariance matrix of the points in OP.
%   C is block diagonal with 3-by-3 blocks.
%
%   [OP,C,EO]=MITPTS(V) returns the external orientation parameters
%   for each camera, where EO(1:3,:) contain the position of the
%   camera centers.

switch i
  case 1
    [OP,COP,EO]=OP1;
  case 2
    [OP,COP,EO]=OP2;
  case 3
    [OP,COP,EO]=OP3;
  otherwise
    error('Bad point set');
end

